  useEffect(() => {
    fetch("http://localhost:3030/jsonstore/todos")
      .then((res) => res.json)
      .then((result) => {
        console.log(result);
      });
  }, []);

  return (
    <div className="App">
      <TaskList />
    </div>
  );
}

export default App;
